import React from 'react';
import './UserHome.css';

function UserHome() {
  return (
    <div className="user-home-container">
      <div className="welcome-message">
        <h2>Welcome, User</h2>
        <p>Your personalized experience awaits.</p>
      </div>
    </div>
  );
}

export default UserHome;
